  false,\n\t\"url\": null,\n\t\"notes\": \"The core function of the Resource Assessment
  and Conservation Engineering (RACE) Division is to conduct quantitative fishery
  surveys and related ecological and oceanographic research to measure and describe
  the distribution and abundance of commercially important fish and crab stocks in
  the eastern Bering Sea, Aleutian Islands, and Gulf of Alaska.  This includes measuring
  the abundance of fish (including rockfishes) in rocky untrawlable areas. To accomplish
  this, we are mapping untrawlable areas using an ME70 multibeam data. These data
  area stored as image files ArcGIS shapefiles\",\n\t\"license_title\": null,\n\t\"extras\":
